  \"afsc-abl-lynn-canal-echo-integrated-trawl-surveys-2001-2004\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The acoustic trawl database for Lynn Canals
  echo-trawl survey was conducted from 2001 to 2004 throughout southern Lynn Canal
  in southeast Alaska. Acoustic surveys were conducted one day per month and trawl
  surveys were conducted every 3 months to verify acoustic signals and collect biological
  data. This study was conducted to study the relationship between Steller sea lions
  (Eumetopias jubatus) and their prey. Additional acoustic surveys were conducted
  throughout the winter of 2004 to 2005 on 6 consecutive days once a month in order
  to study forage fish hots spots. Acoustic equipment were calibrated before every
  trawl survey. Acoustic data were analyzed by the same qualified acoustician throughout
  the surveys duration with calibrations entered into the analytical software after
  each calibration. Trawls were used to identify the fish species associated with
  a specific acoustic signal and to get length weight data per species. Trawl data
  were also used to enumerate and identify all nekton found within the study area
  and to generate length frequencies, species composition and abundance by species
  and season. The acoustic data was use to generate biomass estimates for Pacific
  herring and walleye pollock. Longlines were deployed to better identify and enumerate
  the benthic species not usually caught in pelagic trawls.\",\n\t\"license_title\":
